import React from "react";
import "./Chat.scss";
import ChatHeader from "./ChatHeader";

const Chat = () => {
  return (
    <div className="chat">
      <div className="chat__header">
        <ChatHeader />
      </div>
      <div className="chat__message"></div>
      <div className="chat__input">
        <ChatInput />
      </div>
    </div>
  );
};

export default Chat;
